import React from 'react';
import './Schools.css';

interface SchoolsProps {
  onSelectSchool: (schoolName: string) => void;
}

const Schools: React.FC<SchoolsProps> = ({ onSelectSchool }) => {
  const schools = [
    {
      id: 1,
      name: 'REDSTAR',
      image: '/REDSTAR.JPG',
      location: 'Lanzarote',
    },
    {
      id: 2,
      name: 'SANTA SURF PROCENTER',
      image: '/SANTASURF-PROCENTER.JPG',
      location: 'Lanzarote',
    },
    {
      id: 3,
      name: 'LANZAROTE SURF SCHOOL',
      image: '/LANZAROTE.jpg',
      location: 'Lanzarote',
    },
    {
      id: 4,
      name: 'ZOOPARK',
      image: '/ZOOPARK.jpg',
      location: 'Lanzarote',
    },
    {
      id: 5,
      name: 'MAURI SURF',
      image: '/MAURI-SURF.JPG',
      location: 'Lanzarote',
    },
    {
      id: 6,
      name: 'JMC SURFTRAINING',
      image: '/JMC-SURFTRAINING.jpg',
      location: 'Lanzarote',
    },
    {
      id: 7,
      name: 'VOLCANO',
      image: '/VOLCANO.jpg',
      location: 'Lanzarote',
    },
    {
      id: 8,
      name: 'OTRAS',
      image: '/OTRAS.jpg',
      location: 'Varias',
    },
  ];

  return (
    <div className="schools-page">
      <div className="schools-header">
        <div className="schools-text-block">
          <h1 className="schools-title">Tu escuela, tu día, tus recuerdos</h1>
          <div className="schools-description">
            <p className="description-main">Selecciona la escuela con la que hiciste tu clase de surf.</p>
            <p className="description-secondary">
              Cada escuela tiene su propio espacio dentro de la web, donde encontrarás tus fotos organizadas por fecha.
            </p>
          </div>
        </div>
      </div>

      <div className="schools-container">
        <div className="schools-grid">
          {schools.map((school) => (
            <div 
              key={school.id} 
              className="school-card"
              onClick={() => onSelectSchool(school.name)}
            >
              <div className="school-image-wrapper">
                <img 
                  src={school.image} 
                  alt={school.name}
                  className="school-image"
                />
                <div className="school-overlay">
                  <div className="overlay-content">
                    <span className="view-photos-text">Ver fotos</span>
                    <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={2.5} stroke="currentColor" className="arrow-icon">
                      <path strokeLinecap="round" strokeLinejoin="round" d="M13.5 4.5L21 12m0 0l-7.5 7.5M21 12H3" />
                    </svg>
                  </div>
                </div>
              </div>
              <div className="school-info">
                <h3 className="school-name">{school.name}</h3>
                <div className="school-location">
                  <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={2} stroke="currentColor" className="location-icon">
                    <path strokeLinecap="round" strokeLinejoin="round" d="M15 10.5a3 3 0 11-6 0 3 3 0 016 0z" />
                    <path strokeLinecap="round" strokeLinejoin="round" d="M19.5 10.5c0 7.142-7.5 11.25-7.5 11.25S4.5 17.642 4.5 10.5a7.5 7.5 0 1115 0z" />
                  </svg>
                  <span className="location-text">{school.location}</span>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>

      {/* Sección de ayuda */}
      <div className="schools-help">
        <div className="help-card">
          <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={2} stroke="currentColor" className="help-icon">
            <path strokeLinecap="round" strokeLinejoin="round" d="M9.879 7.519c1.171-1.025 3.071-1.025 4.242 0 1.172 1.025 1.172 2.687 0 3.712-.203.179-.43.326-.67.442-.745.361-1.45.999-1.45 1.827v.75M21 12a9 9 0 11-18 0 9 9 0 0118 0zm-9 5.25h.008v.008H12v-.008z" />
          </svg>
          <h3 className="help-title">¿No encuentras tu escuela?</h3>
          <p className="help-text">Selecciona "OTRAS" y podrás buscar tus fotos igualmente</p>
        </div>
      </div>
    </div>
  );
};

export default Schools;
